import React, { Component } from 'react';

class SearchBar extends Component {
  state = { search: '11' };

  render() {
    return (
      <div>
        <label htmlFor="searchInput">Search</label>
        <input
          id="searchInput"
          type="text"
          value={this.state.search}
          onChange={this.onSearchHandler}
        />
      </div>
    );
  }
}

export default SearchBar;
